var MenuOpen={init:function(){MenuOpen.thinWidth()},thinWidth:function(){var e=$(".top");if(!e.hasClass("hidden")){e.addClass("hidden")}var t=$("#arrow1");var n=$("#arrow2");var r=$("#arrow3");var i=$("#arrow4");t.click(MenuOpen.arrowClick(t));n.click(MenuOpen.arrowClick(n));r.click(MenuOpen.arrowClick(r));i.click(MenuOpen.arrowClick(i))},arrowClick:function(e){var t=e;t.click(function(){var e=t.next().next();{if(t.hasClass("arrow-down")){t.addClass("arrow-up");t.removeClass("arrow-down");e.addClass("visible");e.removeClass("hidden")}else{t.addClass("arrow-down");t.removeClass("arrow-up");e=t.next().next();e.addClass("hidden");e.removeClass("visible")}}})}};MenuOpen.init()